import React from "react";
import "./Employee.css";

const Employee = props => {
  console.log("EMPLOYEE PROPS", props);
  // const [employees, setEmployees] = useState(props.data);
  const employees = props.data;
  return (
    <div className="display-employee" key={employees._id}>
      <h4>{employees.name}</h4>
      <h4>Age: {employees.age}</h4>
      <h4>Eye color: {employees.eyeColor}</h4>
      <h4>Gender: {employees.gender}</h4>
      <h4>Company: {employees.company}</h4>
      <h4>Email: {employees.email}</h4>
      <h4>Phone: {employees.phone}</h4>
      <h4>Address: {employees.address}</h4>
    </div>
  );
};

export default Employee;
